<template>
  <q-dialog
    ref="refDialog"
    no-backdrop-dismiss
  >
    <div style="min-width: 70%;">
      <q-card flat style="border-radius: 20px;">
        <q-card-section class="row justify-between q-px-lg text-white">
          <span class="text-30 weight-600">Protótipo de edição de PDF</span>

          <q-btn
            round
            flat
            v-close-popup
            icon="close"
          />
        </q-card-section>

        <q-card-section>
          <div
            ref="scrollContainer"
            class="row no-wrap pdf-comments-container"
          >
            <!-- PDF + overlay -->
            <div class="relative-position">
              <canvas ref="pdfCanvas"></canvas>
              <canvas
                ref="overlayCanvas"
                class="absolute-top-left"
                style="z-index: 10; pointer-events: auto;"
                @click="handleCanvasClick"
              ></canvas>
            </div>

            <!-- Cards de comentários -->
            <div class="comment-column">
              <div
                v-for="(coord, index) in clickedCoordsByPage[currentPage] || []"
                :key="index"
                class="comment-card absolute-left"
                :style="{ top: `${coord.y}px` }"
              >
                <q-card class="bg-white text-black" style="width: 200px;">
                  <q-card-section>
                    Página {{ currentPage }}<br />
                    X: {{ coord.x }} | Y: {{ coord.y }}
                  </q-card-section>
                </q-card>
              </div>
            </div>
          </div>
        </q-card-section>

        <q-card-section class="q-gutter-sm row items-center">
          <q-btn flat label="Anterior" :disable="currentPage <= 1" @click="changePage(-1)" />
          <div>Página {{ currentPage }} de {{ totalPages }}</div>
          <q-btn flat label="Próxima" :disable="currentPage >= totalPages" @click="changePage(1)"/>
        </q-card-section>
      </q-card>
    </div>
  </q-dialog>
</template>
<script>
import * as pdfjsLib from 'pdfjs-dist';
import workerSrc from 'pdfjs-dist/build/pdf.worker.mjs?url';

pdfjsLib.GlobalWorkerOptions.workerSrc = workerSrc;

export default {
  data () {
    return {
      pdfBase64: '',
      clickedCoordsByPage: {},
      currentPage: 1,
      totalPages: 1,
      pdfDoc: null
    }
  },
  mounted () {
    this.loadPdf()
  },
  methods: {
    async loadPdf () {
      const cleanBase64 = this.pdfBase64.replace(/\s/g, '')
      const binaryString = atob(cleanBase64)
      const bytes = new Uint8Array(binaryString.length)
      for (let i = 0; i < binaryString.length; i++) {
        bytes[i] = binaryString.charCodeAt(i)
      }

      const loadingTask = pdfjsLib.getDocument({ data: bytes })
      const pdf = await loadingTask.promise
      this.totalPages = pdf.numPages
      const page = await pdf.getPage(this.currentPage)

      const scale = 1.5;
      const viewport = page.getViewport({ scale });

      const canvas = this.$refs.pdfCanvas;
      const context = canvas.getContext('2d');
      canvas.width = viewport.width;
      canvas.height = viewport.height;

      const overlay = this.$refs.overlayCanvas;
      overlay.width = viewport.width;
      overlay.height = viewport.height;

      await page.render({ canvasContext: context, viewport }).promise;
    },

    changePage (delta) {
      const newPage = this.currentPage + delta;
      if (newPage >= 1 && newPage <= this.totalPages) {
        this.currentPage = newPage;
        this.loadPdf();
      }
    },

    handleCanvasClick(event) {
      const rect = this.$refs.overlayCanvas.getBoundingClientRect()
      const x = event.clientX - rect.left
      const y = event.clientY - rect.top

      const coord = { x: Math.round(x), y: Math.round(y) }
      const page = this.currentPage

      if (!this.clickedCoordsByPage[page]) {
        this.clickedCoordsByPage[page] = []
      }

      this.clickedCoordsByPage[page].push(coord)
    }
  }
}
</script>
<style>
.relative-position {
  position: relative;
}

.pdf-comments-container {
  overflow-y: auto;
  max-height: 70vh;
  border: 1px solid #ccc;
  position: relative;
}

.comment-column {
  position: relative;
  margin-left: 16px;
  flex-shrink: 0;
  width: 220px;
}

.comment-card {
  position: absolute;
}

</style>
